const createArrayOfOptions = (stringCSV) => {
    let arrays = stringCSV.split('end');
    let result = [];

    for (i = 0; i < arrays.length; i++) {
        let maneuverRatingSplit = arrays[i].split(',/,');
        let maneuverArraySplit = [];
        maneuverArraySplit.push(maneuverRatingSplit[0].split(','));
        maneuverArraySplit.push(maneuverRatingSplit[1].split(','));

        result.push(maneuverArraySplit);
    }

    console.log(result);
};

